import React from "react";
import { useHistory } from "react-router-dom";
import MainPage from "./mainpage";








export default function Redirect() {
    const history = useHistory
    return(
<MainPage>
       <div style={{display:'flex' , justifyContent:'center' , alignItems:'center' , flex}}>
        <p style={{fontSize:'100px'}}>404</p>
        <p>Page not found</p>
        <a onClick={()=> history.push('/')} style={{textDecoration:'none',color:'blue'}}><span><i class="bi bi-arrow-left"></i></span>Back to dashboard</a>
       </div>
       </MainPage>

    );
}
